import React from 'react';
import { ResponsiveCalendar } from '@nivo/calendar';

export default function MyResponsiveCalendar(props) {
  return (
      <ResponsiveCalendar
        data={props.data}
        from={props.from}
        to={props.to}
        granularity="month"
        emptyColor="#eeeeee"
        colors={props.colors}
        margin={props.margin}
        yearSpacing={0}
        monthBorderColor="grey"
        dayBorderWidth={2}
        dayBorderColor="#ffffff"
        align={props.align}
      />
  );
}
